import ReactRoundedImage from "react-rounded-image";
import Picture from "./ProfilePic.jpeg";

function ProfilePicture() {
    return (
        <div style={{ display: "flex" }}>
        <ReactRoundedImage image={MyPhoto} />
        <ReactRoundedImage
          image={MyPhoto}
          roundedColor="#321124"
          imageWidth="150"
          imageHeight="150"
          roundedSize="13"
          borderRadius="70"
        />

        <ReactRoundedImage
          image={MyPhoto}
          roundedColor="#66A5CC"
          imageWidth="120"
          imageHeight="120"
          roundedSize="8"
          borderRadius="15"
        />

        <ReactRoundedImage image={MyPhoto} roundedSize="0" imageWidth="110" imageHeight="110" />
      </div>
    );
}

function HomePage() {
    return (
        <div>
            THIS IS THE HOME PAGE
        </div>
    );
}

export default HomePage;
